import React, { Fragment, Component } from 'react'
import PropTypes from 'prop-types'
import ColorScheme from '../../libs/ColorScheme'
import { faTimes } from '@fortawesome/free-solid-svg-icons'
import './ColorSchemeModal.css'

class ColorSchemeModal extends Component {

    render () {
        console.log("Should show modal? " + this.props.shouldShow)
        return (
            <div style={{display: `${this.props.shouldShow ? "block" : "none"}`}} className="color-scheme-modal-wrapper">
                <div className="color-scheme-modal-header">THIS IS A HEADER</div>
                <div className="color-scheme-modal-body">THIS IS A BODY</div>
                <div className="color-scheme-modal-footer">THIS IS A FOOTER</div>
            </div>
        )
    }
}

ColorSchemeModal.propTypes = {
    shouldShow: PropTypes.bool.isRequired,
    colorSchemeSelected: PropTypes.func.isRequired,
    cancelSelected: PropTypes.func.isRequired
}

export default ColorSchemeModal
